import Link from "next/link";
import Typography from "@material-ui/core/Typography";

export default function Sections() {
  return (
    <div className="sectionsWrapper">
      <div>test</div>

      <Link href="/sale">
        <a className="item">
          <Typography variant="h6" className="link">
            Sale
          </Typography>
        </a>
      </Link>
      <Link href="/sympathy">
        <a className="item">
          <Typography variant="h6" className="link">
            Sympathy
          </Typography>
        </a>
      </Link>
      <Link href="/gifts">
        <a className="item">
          <Typography variant="h6" className="link">
            Gifts
          </Typography>
        </a>
      </Link>
      <Link href="/plants">
        <a className="item">
          <Typography variant="h6" className="link">
            Plants
          </Typography>
        </a>
      </Link>
      <Link href="/birthday">
        <a className="item">
          <Typography variant="h6" className="link">
            Birthday
          </Typography>
        </a>
      </Link>
      <Link href="/samedaydelivery">
        <a className="item">
          <Typography variant="h6" className="link">
            Same Day Delivery
          </Typography>
        </a>
      </Link>
      <style jsx>{`
        .sectionsWrapper {
          display: flex;
          align-items: center;
          flex-wrap: nowrap;
          height: 100%;
        }
        ,
        .item {
          flex-grow: 1;
          text-decoration: none;
        }

        ,
        .link {
          color: #8e7329;
          text-align: center;
        }

        ,
        .link::hover {
          color: #755e1e;
          cursor: pointer;
          text-decoration: underline;
        }
      `}</style>
    </div>
  );
}
